import React, { useState } from 'react';
import './DisposeMenu.css';
import 'react-toastify/dist/ReactToastify.css';

const AdminDashboard = () => {
    const [usersData, setUsersData] = useState(null); // State to hold the fetched data

    const items = [
        { name: 'Computers', image: 'logo192.png' },
        { name: 'IC Computers', image: 'logo192.png' },
        { name: 'Laptops', image: 'logo192.png' },
        { name: 'Mobile Phones', image: 'logo192.png' },
        { name: 'Large Items', image: 'logo192.png' },
        { name: 'Small Items', image: 'logo192.png' },
    ];

    const handleClick = (item) => {
        if (item.name === 'Computers') {
            fetchComputerData(); // Fetch data when Computers item is clicked
        }
    };

    const fetchComputerData = async () => {
        try {
            const response = await fetch('http://localhost:8090/api/v1/items/computers');
            if (!response.ok) {
                throw new Error('Failed to fetch data');
            }
            const data = await response.json();
            setUsersData(data); // Set the fetched data into state
        } catch (error) {
            console.error('Error fetching data:', error);
            // Handle error: show toast message or display error UI
        }
    };

    return (
        <div className="dispose-menu-container">
            <h2>Choose a Category</h2><br/><br/>
            <div className="dispose-items">
                {items.map((item, index) => (
                    <div key={index} className="dispose-item" onClick={() => handleClick(item)}>
                        <img src={process.env.PUBLIC_URL + '/' + item.image} alt={item.name} />
                        <p>{item.name}</p>
                    </div>
                ))}
            </div>

            {usersData && usersData.length > 0 && ( // Check if usersData is not null and has elements
                <div className="users-table">
                    <h3>List of Users with Computers</h3>
                    <table>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Phone Number</th>
                                <th>Location</th>
                                <th>Computer Brand</th>
                                <th>Years Used</th>
                                <th>Description</th>
                                <th>Image</th>
                            </tr>
                        </thead>
                        <tbody>
                            {usersData.map((user, index) => (
                                <tr key={index}>
                                    <td>{user.signup ? user.signup.name : 'N/A'}</td>
                                    <td>{user.signup ? user.signup.email : 'N/A'}</td>
                                    <td>{user.signup ? user.signup.phone_no : 'N/A'}</td>
                                    <td>{user.signup ? user.signup.location : 'N/A'}</td>
                                    <td>{user.brand}</td>
                                    <td>{user.yearsUsed}</td>
                                    <td>{user.description}</td>
                                    <td>
                                        <img src={`http://localhost:8090/api/v1/items/computers/${user.id}`} alt={user.brand} style={{ width: '100px', height: 'auto' }} />
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
};

export default AdminDashboard;
